// optionCache.js
let cache = null;

export async function getAllOptions() {
  if (cache) return cache;

  const suppliers = await getOption("supplierDetails");
  const consignees = await getOption("consignee");
  const emptyLocations = await getOption("unloadVenue");
  const status = await getOption("status");
  const type = await getOption("containerType");
  const shipping = await getOption("shippingDocument");

  cache = { suppliers, consignees, emptyLocations, status, type, shipping };
  return cache;
}
